import React from 'react';
import TodoInput from './component/TodoInput';
import TodoList from './component/TodoList';
import TodoItem from './component/TodoItem';

function App() {
  return (
    <div className="App">
      <h1>Hellod
      </h1>
      <TodoInput/>
      <TodoList/>
      <TodoItem/>
    </div>
  );
}

export default App;
